export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},Y38yLyVa6O:{data:{id:1836,attributes:{imdbId:"tt0396752",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjAwNDUxODEwMF5BMl5BanBnXkFtZTcwMzgyMTIzMQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"74%"},{Source:"Metacritic",Value:"59\u002F100"}],item_lang:{data:{id:2499,attributes:{title:"Nanny McPhee",plot:"1860s Victorian England. Sadly, the widowed undertaker, Cedric Brown, has a lot on his plate. As the desperate father works his fingers to the bone to provide for his seven unruly children, in the meantime, they have managed to drive out not one but seventeen nannies with their elaborate practical jokes and bad behaviour. Then, on a stormy night, the hideous government nanny extraordinaire, Nanny McPhee, sets foot in Cedric's household, bent on transforming the children's manners and the house. Will a dash of magic do the trick?",slug:"nanny-mcphee"}}},books:{data:[{id:9321,attributes:{title:"Nurse Matilda Goes to Hospital",description:"Once upon a time there was a huge family of children, and they were terribly, terribly naughty ... The Brown children are back, and they're naughtier than ever! This time, they have feigned illness and been taken to hospital ... but with the no-nonsense, magical Nurse Matilda running the show, they have little chance of keeping up their antics for long! This highly collectable new edition of a timeless classic is packed with episode after episode of mischief, mayhem and hilarity, all accompanied by Edward Ardizzone's beautiful original illustrations. From the series that inspired the much-loved film Nanny McPhee, starring Emma Thompson and Colin Firth, Nurse Matilda Goes to Hospital overflows with naughtiness, wit and timeless humour – the perfect book for mischief-makers both young and old!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WcwAEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:e,publisher:f,subtitle:c}},{id:9322,attributes:{title:i,description:"Once upon a time there was a huge family of children; and they were terribly, terribly naughty ... So begins Nurse Matilda, the first of three books about the no-nonsense nanny who uses magic to rein in the mischievous children in her charge – and changes their lives forever. This covetable, highly collectable new hardback edition of a timeless classic is packed with episode after episode of mischief, mayhem and hilarity, all accompanied by Edward Ardizzone's beautiful original illustrations. The inspiration for the much-loved film Nanny McPhee, starring Emma Thompson and Colin Firth, Nurse Matilda overflows with naughtiness, wit and timeless humour – the perfect gift for mischief-makers both young and old!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AkDwDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:e,publisher:f,subtitle:c}},{id:9323,attributes:{title:"Nurse Matilda Goes to Town",description:"Once upon a time there was a huge family of children, and they were terribly, terribly naughty ... Mr and Mrs Brown thought that their children had been cured of naughtiness by the inimitable, magical Nurse Matilda. But now, with Nurse Matilda gone, the children have slipped back into their wicked ways: Tora has put glue in the sandwiches; Emma has made a chocolate cake out of mud; David has put a toad in the milk jug; and Tim is tying Nanny's shoelaces to her chair! Their stay in London with their Great Aunt Adelaide seems set for disaster – until the arrival of Nurse Matilda ... This highly collectable new edition of a timeless classic is packed with episode after episode of mischief, mayhem and hilarity, all accompanied by Edward Ardizzone's beautiful original illustrations. From the series that inspired the much-loved film Nanny McPhee, starring Emma Thompson and Colin Firth, Nurse Matilda Goes to Town overflows with naughtiness, wit and timeless humour – the perfect book for mischief-makers both young and old!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=W8wAEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:e,publisher:f,subtitle:c}},{id:9324,attributes:{title:i,description:"The incorrigible Brown children, who devour nannies, nurse-maids, and governesses, finally meet their match.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=km3Tt87hh_kC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Edward Ardizzone"],firstBook:d,published:"2005-03-03",publisher:"Bloomsbury Publishing USA",subtitle:"The Collected Tales"}},{id:9325,attributes:{title:"Tour de Force",description:"Inspector Cockrill’s dull vacation is jolted by a Mediterranean murderFrom the moment he steps on the plane, Inspector Cockrill loathes his fellow travelers. They are typical tour group bores: the dullards of England whom he had hoped to escape by going to Italy. He gives up on the trip immediately, burying his nose in a mystery novel to ensure that no one tries to become his friend. But not long after the group makes landfall at the craggy isle of San Juan el Pirata, a murder demands his attention. The body of a woman is found laid out carefully on her bed, blood pooled around her and fingers wrapped around the dagger that took her life. The corrupt local police force, impatient to find a killer, names Cockrill chief suspect. To escape the Italian hangman, the detective must find out who would go on vacation to kill a stranger.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ky9HApzEb30C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2011-11-01",publisher:"Open Road Media",subtitle:c}}]}}},meta:{}}},prerenderedAt:1681377290868}}("Christianna Brand","movie","",null,"2020-10-01","Bloomsbury Publishing","series",1,"Nurse Matilda"))